REATE TABLE appraisal_data (
    list INT,
    list_address VARCHAR(42) CHARACTER SET utf8,
    list_assessed_value INT,
    list_city VARCHAR(12) CHARACTER SET utf8,
    list_deed_xfer VARCHAR(10) CHARACTER SET utf8,
    list_full_tax NUMERIC(32, 16),
    list_hs_tax NUMERIC(32, 16),
    list_improvement INT,
    list_market_value INT,
    list_name VARCHAR(31) CHARACTER SET utf8,
    list_pid INT,
    list_state VARCHAR(5) CHARACTER SET utf8,
    list_tax_year INT,
    list_taxing_entities VARCHAR(69) CHARACTER SET utf8,
    list_zip INT
);
